(window.webpackJsonp=window.webpackJsonp||[]).push([[16],{688:function(e,n,r){"use strict";r.r(n),n.default='# Markdown Kitchen Sink\r\nThis file is https://github.com/adam-p/markdown-here/wiki/Markdown-Cheatsheet plus a few fixes and additions. Used by [obedm503/bootmark](https://github.com/obedm503/bootmark) to [demonstrate](https://obedm503.github.io/bootmark/docs/markdown-cheatsheet.html) it\'s styling features.\r\n\r\nThis is intended as a quick reference and showcase. For more complete info, see [John Gruber\'s original spec](http://daringfireball.net/projects/markdown/) and the [Github-flavored Markdown info page](http://github.github.com/github-flavored-markdown/).\r\n\r\nNote that there is also a [Cheatsheet specific to Markdown Here](./Markdown-Here-Cheatsheet) if that\'s what you\'re looking for. You can also check out [more Markdown tools](./Other-Markdown-Tools).\r\n\r\n##### Table of Contents  \r\n[Headers](#headers)  \r\n[Emphasis](#emphasis)  \r\n[Lists](#lists)  \r\n[Links](#links)  \r\n[Images](#images)  \r\n[Code and Syntax Highlighting](#code)  \r\n[Tables](#tables)  \r\n[Blockquotes](#blockquotes)  \r\n[Inline HTML](#html)  \r\n[Horizontal Rule](#hr)  \r\n[Line Breaks](#lines)  \r\n[YouTube Videos](#videos)  \r\n\r\n<a name="headers"></a>\r\n\r\n## Headers\r\n\r\n```no-highlight\r\n# H1\r\n## H2\r\n### H3\r\n#### H4\r\n##### H5\r\n###### H6\r\n\r\nAlternatively, for H1 and H2, an underline-ish style:\r\n\r\nAlt-H1\r\n======\r\n\r\nAlt-H2\r\n------\r\n```\r\n\r\n# H1\r\n## H2\r\n### H3\r\n#### H4\r\n##### H5\r\n###### H6\r\n\r\nAlternatively, for H1 and H2, an underline-ish style:\r\n\r\nAlt-H1\r\n======\r\n\r\nAlt-H2\r\n------\r\n\r\n<a name="emphasis"></a>\r\n\r\n## Emphasis\r\n\r\n```no-highlight\r\nEmphasis, aka italics, with *asterisks* or _underscores_.\r\n\r\nStrong emphasis, aka bold, with **asterisks** or __underscores__.\r\n\r\nCombined emphasis with **asterisks and _underscores_**.\r\n\r\nStrikethrough uses two tildes. ~~Scratch this.~~\r\n```\r\n\r\nEmphasis, aka italics, with *asterisks* or _underscores_.\r\n\r\nStrong emphasis, aka bold, with **asterisks** or __underscores__.\r\n\r\nCombined emphasis with **asterisks and _underscores_**.\r\n\r\nStrikethrough uses two tildes. ~~Scratch this.~~\r\n\r\n\r\n<a name="lists"></a>\r\n\r\n## Lists\r\n\r\n(In this example, leading and trailing spaces are shown with with dots: ⋅)\r\n\r\n```no-highlight\r\n1. First ordered list item\r\n2. Another item\r\n⋅⋅* Unordered sub-list. \r\n1. Actual numbers don\'t matter, just that it\'s a number\r\n⋅⋅1. Ordered sub-list\r\n4. And another item.\r\n\r\n⋅⋅⋅You can have properly indented paragraphs within list items. Notice the blank line above, and the leading spaces (at least one, but we\'ll use three here to also align the raw Markdown).\r\n\r\n⋅⋅⋅To have a line break without a paragraph, you will need to use two trailing spaces.⋅⋅\r\n⋅⋅⋅Note that this line is separate, but within the same paragraph.⋅⋅\r\n⋅⋅⋅(This is contrary to the typical GFM line break behaviour, where trailing spaces are not required.)\r\n\r\n* Unordered list can use asterisks\r\n- Or minuses\r\n+ Or pluses\r\n```\r\n\r\n1. First ordered list item\r\n2. Another item\r\n  * Unordered sub-list. \r\n1. Actual numbers don\'t matter, just that it\'s a number\r\n  1. Ordered sub-list\r\n4. And another item.\r\n\r\n   You can have properly indented paragraphs within list items. Notice the blank line above, and the leading spaces (at least one, but we\'ll use three here to also align the raw Markdown).\r\n\r\n   To have a line break without a paragraph, you will need to use two trailing spaces.  \r\n   Note that this line is separate, but within the same paragraph.  \r\n   (This is contrary to the typical GFM line break behaviour, where trailing spaces are not required.)\r\n\r\n* Unordered list can use asterisks\r\n- Or minuses\r\n+ Or pluses\r\n\r\n<a name="links"></a>\r\n\r\n## Links\r\n\r\nThere are two ways to create links.\r\n\r\n```no-highlight\r\n[I\'m an inline-style link](https://www.google.com)\r\n\r\n[I\'m an inline-style link with title](https://www.google.com "Google\'s Homepage")\r\n\r\n[I\'m a reference-style link][Arbitrary case-insensitive reference text]\r\n\r\n[I\'m a relative reference to a repository file](../blob/master/LICENSE)\r\n\r\n[You can use numbers for reference-style link definitions][1]\r\n\r\nOr leave it empty and use the [link text itself].\r\n\r\nURLs and URLs in angle brackets will automatically get turned into links. \r\nhttp://www.example.com or <http://www.example.com> and sometimes \r\nexample.com (but not on Github, for example).\r\n\r\nSome text to show that the reference links can follow later.\r\n\r\n[arbitrary case-insensitive reference text]: https://www.mozilla.org\r\n[1]: http://slashdot.org\r\n[link text itself]: http://www.reddit.com\r\n```\r\n\r\n[I\'m an inline-style link](https://www.google.com)\r\n\r\n[I\'m an inline-style link with title](https://www.google.com "Google\'s Homepage")\r\n\r\n[I\'m a reference-style link][Arbitrary case-insensitive reference text]\r\n\r\n[I\'m a relative reference to a repository file](../blob/master/LICENSE)\r\n\r\n[You can use numbers for reference-style link definitions][1]\r\n\r\nOr leave it empty and use the [link text itself].\r\n\r\nURLs and URLs in angle brackets will automatically get turned into links. \r\nhttp://www.example.com or <http://www.example.com> and sometimes \r\nexample.com (but not on Github, for example).\r\n\r\nSome text to show that the reference links can follow later.\r\n\r\n[arbitrary case-insensitive reference text]: https://www.mozilla.org\r\n[1]: http://slashdot.org\r\n[link text itself]: http://www.reddit.com\r\n\r\n<a name="images"></a>\r\n\r\n## Images\r\n\r\n```no-highlight\r\nHere\'s our logo (hover to see the title text):\r\n\r\nInline-style: \r\n![alt text](https://github.com/adam-p/markdown-here/raw/master/src/common/images/icon48.png "Logo Title Text 1")\r\n\r\nReference-style: \r\n![alt text][logo]\r\n\r\n[logo]: https://github.com/adam-p/markdown-here/raw/master/src/common/images/icon48.png "Logo Title Text 2"\r\n```\r\n\r\nHere\'s our logo (hover to see the title text):\r\n\r\nInline-style: \r\n![alt text](https://github.com/adam-p/markdown-here/raw/master/src/common/images/icon48.png "Logo Title Text 1")\r\n\r\nReference-style: \r\n![alt text][logo]\r\n\r\n[logo]: https://github.com/adam-p/markdown-here/raw/master/src/common/images/icon48.png "Logo Title Text 2"\r\n\r\n<a name="code"></a>\r\n\r\n## Code and Syntax Highlighting\r\n\r\nCode blocks are part of the Markdown spec, but syntax highlighting isn\'t. However, many renderers -- like Github\'s and *Markdown Here* -- support syntax highlighting. Which languages are supported and how those language names should be written will vary from renderer to renderer. *Markdown Here* supports highlighting for dozens of languages (and not-really-languages, like diffs and HTTP headers); to see the complete list, and how to write the language names, see the [highlight.js demo page](http://softwaremaniacs.org/media/soft/highlight/test.html).\r\n\r\n```no-highlight\r\nInline `code` has `back-ticks around` it.\r\n```\r\n\r\nInline `code` has `back-ticks around` it.\r\n\r\nBlocks of code are either fenced by lines with three back-ticks <code>```</code>, or are indented with four spaces. I recommend only using the fenced code blocks -- they\'re easier and only they support syntax highlighting.\r\n\r\n<pre lang="no-highlight"><code>```javascript\r\nvar s = "JavaScript syntax highlighting";\r\nalert(s);\r\n```\r\n \r\n```python\r\ns = "Python syntax highlighting"\r\nprint s\r\n```\r\n \r\n```\r\nNo language indicated, so no syntax highlighting. \r\nBut let\'s throw in a &lt;b&gt;tag&lt;/b&gt;.\r\n```\r\n</code></pre>\r\n\r\n\r\n\r\n```javascript\r\nvar s = "JavaScript syntax highlighting";\r\nalert(s);\r\n```\r\n\r\n```python\r\ns = "Python syntax highlighting"\r\nprint s\r\n```\r\n\r\n```\r\nNo language indicated, so no syntax highlighting in Markdown Here (varies on Github). \r\nBut let\'s throw in a <b>tag</b>.\r\n```\r\n\r\n\r\n<a name="tables"></a>\r\n\r\n## Tables\r\n\r\nTables aren\'t part of the core Markdown spec, but they are part of GFM and *Markdown Here* supports them. They are an easy way of adding tables to your email -- a task that would otherwise require copy-pasting from another application.\r\n\r\n```no-highlight\r\nColons can be used to align columns.\r\n\r\n| Tables        | Are           | Cool  |\r\n| ------------- |:-------------:| -----:|\r\n| col 3 is      | right-aligned | $1600 |\r\n| col 2 is      | centered      |   $12 |\r\n| zebra stripes | are neat      |    $1 |\r\n\r\nThere must be at least 3 dashes separating each header cell.\r\nThe outer pipes (|) are optional, and you don\'t need to make the \r\nraw Markdown line up prettily. You can also use inline Markdown.\r\n\r\nMarkdown | Less | Pretty\r\n--- | --- | ---\r\n*Still* | `renders` | **nicely**\r\n1 | 2 | 3\r\n```\r\n\r\nColons can be used to align columns.\r\n\r\n| Tables        | Are           | Cool |\r\n| ------------- |:-------------:| -----:|\r\n| col 3 is      | right-aligned | $1600 |\r\n| col 2 is      | centered      |   $12 |\r\n| zebra stripes | are neat      |    $1 |\r\n\r\nThere must be at least 3 dashes separating each header cell. The outer pipes (|) are optional, and you don\'t need to make the raw Markdown line up prettily. You can also use inline Markdown.\r\n\r\nMarkdown | Less | Pretty\r\n--- | --- | ---\r\n*Still* | `renders` | **nicely**\r\n1 | 2 | 3\r\n\r\n<a name="blockquotes"></a>\r\n\r\n## Blockquotes\r\n\r\n```no-highlight\r\n> Blockquotes are very handy in email to emulate reply text.\r\n> This line is part of the same quote.\r\n\r\nQuote break.\r\n\r\n> This is a very long line that will still be quoted properly when it wraps. Oh boy let\'s keep writing to make sure this is long enough to actually wrap for everyone. Oh, you can *put* **Markdown** into a blockquote. \r\n```\r\n\r\n> Blockquotes are very handy in email to emulate reply text.\r\n> This line is part of the same quote.\r\n\r\nQuote break.\r\n\r\n> This is a very long line that will still be quoted properly when it wraps. Oh boy let\'s keep writing to make sure this is long enough to actually wrap for everyone. Oh, you can *put* **Markdown** into a blockquote. \r\n\r\n<a name="html"></a>\r\n\r\n## Inline HTML\r\n\r\nYou can also use raw HTML in your Markdown, and it\'ll mostly work pretty well. \r\n\r\n```no-highlight\r\n<dl>\r\n  <dt>Definition list</dt>\r\n  <dd>Is something people use sometimes.</dd>\r\n\r\n  <dt>Markdown in HTML</dt>\r\n  <dd>Does *not* work **very** well. Use HTML <em>tags</em>.</dd>\r\n</dl>\r\n```\r\n\r\n<dl>\r\n  <dt>Definition list</dt>\r\n  <dd>Is something people use sometimes.</dd>\r\n\r\n  <dt>Markdown in HTML</dt>\r\n  <dd>Does *not* work **very** well. Use HTML <em>tags</em>.</dd>\r\n</dl>\r\n\r\n<a name="hr"></a>\r\n\r\n## Horizontal Rule\r\n\r\n```\r\nThree or more...\r\n\r\n---\r\n\r\nHyphens\r\n\r\n***\r\n\r\nAsterisks\r\n\r\n___\r\n\r\nUnderscores\r\n```\r\n\r\nThree or more...\r\n\r\n---\r\n\r\nHyphens\r\n\r\n***\r\n\r\nAsterisks\r\n\r\n___\r\n\r\nUnderscores\r\n\r\n<a name="lines"></a>\r\n\r\n## Line Breaks\r\n\r\nMy basic recommendation for learning how line breaks work is to experiment and discover -- hit &lt;Enter&gt; once (i.e., insert one newline), then hit it twice (i.e., insert two newlines), see what happens. You\'ll soon learn to get what you want. "Markdown Toggle" is your friend. \r\n\r\nHere are some things to try out:\r\n\r\n```\r\nHere\'s a line for us to start with.\r\n\r\nThis line is separated from the one above by two newlines, so it will be a *separate paragraph*.\r\n\r\nThis line is also a separate paragraph, but...\r\nThis line is only separated by a single newline, so it\'s a separate line in the *same paragraph*.\r\n```\r\n\r\nHere\'s a line for us to start with.\r\n\r\nThis line is separated from the one above by two newlines, so it will be a *separate paragraph*.\r\n\r\nThis line is also begins a separate paragraph, but...  \r\nThis line is only separated by a single newline, so it\'s a separate line in the *same paragraph*.\r\n\r\n(Technical note: *Markdown Here* uses GFM line breaks, so there\'s no need to use MD\'s two-space line breaks.)\r\n\r\n<a name="videos"></a>\r\n\r\n## YouTube Videos\r\n\r\nThey can\'t be added directly but you can add an image with a link to the video like this:\r\n\r\n```no-highlight\r\n<a href="http://www.youtube.com/watch?feature=player_embedded&v=YOUTUBE_VIDEO_ID_HERE\r\n" target="_blank"><img src="http://img.youtube.com/vi/YOUTUBE_VIDEO_ID_HERE/0.jpg" \r\nalt="IMAGE ALT TEXT HERE" width="240" height="180" border="10" /></a>\r\n```\r\n\r\nOr, in pure Markdown, but losing the image sizing and border:\r\n\r\n```no-highlight\r\n[![IMAGE ALT TEXT HERE](http://img.youtube.com/vi/YOUTUBE_VIDEO_ID_HERE/0.jpg)](http://www.youtube.com/watch?v=YOUTUBE_VIDEO_ID_HERE)\r\n```\r\n'},713:function(e,n,r){"use strict";r.r(n);var t={filters:{markdown:r(77).default},data:function(){return{text:r(688).default}}},a=r(2),i=Object(a.a)(t,function(){var e=this.$createElement;return(this._self._c||e)("n-text",{domProps:{innerHTML:this._f("markdown")(this.text)}})},[],!1,null,null,null);n.default=i.exports}}]);